package org.example.mirai.plugin.toolkit;

import java.io.*;
import java.util.Base64;
import java.util.Base64.Decoder;

/**
 * CreateImg class
 *
 * @author 649953543@qq.com
 * @date 2021/09/22
 */

public class CreateImg {

    public void createYc() {
        String yc1 = "";
        String yc2 = "";
        generateImage(yc1 + yc2, "yc.jpg");
    }

    public void createQrcode() {
        String qrcode = "";
        generateImage(qrcode, "qrcode.png");
    }


    public static void generateImage(String imgStr, String imgName) { //Base64
        Utils utils = new Utils();
        Decoder decoder = Base64.getDecoder();
        try {
            //Base64
            byte[] b = decoder.decode(imgStr);
            for (int i = 0; i < b.length; ++i) {
                //
                if (b[i] < 0) {
                    b[i] += 256;
                }
            }
            //
            String imgFilePath = utils.getPluginsDataPath() + "/" + imgName;
            OutputStream out = new FileOutputStream(imgFilePath);
            out.write(b);
            out.flush();
            out.close();
        } catch (Exception e) {
           e.printStackTrace();
        }
    }
}
